een leuke film

met de stemmen van Elijah Wood, John C. Reilly en Jennifer Connelly

Wanneer de lappenpop 9 (Elijah Wood) voor het eerst tot leven komt, ziet hij dat hij zich in een post-apocalyptische wereld 
bevindt. Al het menselijk leven is verdwenen, maar bij toeval vindt hij een kleine gemeenschap met soortgenoten die zich 
verstoppen voor de vreselijke machines die op aarde rondzwerven. Deze machines proberen alles en iedereen uit te roeien, omdat 
zij de volledige controle en macht over de wereld willen hebben. 9 weet - ondanks dat hij het groentje uit de groep is - zijn 
soortgenoten te overtuigen dat verstoppen geen oplossing is. Ze moeten terugslaan als ze willen overleven. Wat ze snel zullen 
leren is dat de toekomst van hun beschaving van henzelf afhangt...
